void test_binary_division(s21_decimal dividend, s21_decimal divisor,
                          s21_decimal quotient, s21_decimal remainder) {
  s21_decimal result;
  s21_decimal result_remainder;
  result = s21_decimal_binary_division(dividend, divisor, &result_remainder);

#if defined(__DEBUG)
  s21_print_decimal_bits(dividend);
  s21_print_decimal_string(dividend);
  s21_print_decimal_bits(divisor);
  s21_print_decimal_string(divisor);
  printf("\n");
  s21_print_decimal_bits(quotient);
  s21_print_decimal_string(quotient);
  s21_print_decimal_bits(result);
  s21_print_decimal_string(result);
  printf("\n");
  s21_print_decimal_bits(remainder);
  s21_print_decimal_string(remainder);
  s21_print_decimal_bits(result_remainder);
  s21_print_decimal_string(result_remainder);
#endif

  ck_assert_int_eq(s21_is_equal(result, quotient), 1);
  ck_assert_int_eq(s21_is_equal(result_remainder, remainder), 1);
  ck_assert_int_eq(s21_decimal_get_sign(result),
                   s21_decimal_get_sign(quotient));
  ck_assert_int_eq(s21_decimal_get_sign(result_remainder),
                   s21_decimal_get_sign(remainder));
}
